This week will be part 1/2, chatting about melatonin...

Q: What factors would cause melatonin to be low?

A: Melatonin, is not a sex hormone or an adrenal hormone, but it is highly involved in the entire endocrine system, including the female sex hormones.

Which is why we love that it is included in the DUTCH test, for us to see the current level and how it relates the rest of a client's hormonal balance.

It is made in the pineal gland which is located in the brain in response to darkness (and there are also significant quantities made in the gut) which is why a great sleep routine and hygiene is very important to improving melatonin levels.

Low melatonin levels may be associated with:
‚û°Ô∏èInsomnia
‚û°Ô∏èPoor immune response
‚û°Ô∏èConstipation
‚û°Ô∏èWeight gain
‚û°Ô∏èIncreased appetite
‚û°Ô∏èAnxiety

So what would cause low melatonin levels to occur in the first place?
Well, Stress and looking at the health and overall functioning of the HPA (Hypothalamus - Pituitary - Adrenal ) axis is crucial here

When you are experiencing a lot of chronic stress, you release cortisol and this can interfere with melatonin release.

Normally, cortisol levels naturally rise in the morning (which helps you wake up and feel awake) and then decreases the rest of the day, as melatonin rises prepping the body for bedtime.

However, when someone is very stressed, the elevated cortisol is still very high in the evening/night and this interferes with the release of melatonin. Therefore, having low melatonin & higher levels of cortisol in the night. Overall leaving you feeling tired and like you didn‚Äôt have a restful or restorative sleep.

Some other major causes that can contribute to low melatonin:
